import React, { useState, useEffect } from "react";
import { Button } from "@mui/material";
import { Link } from "react-router-dom";

function List() {
  const [universitiesData, setUniversitiesData] = useState([]);
  const [selectedName, setSelectedName] = useState("");
  const [selectedFee, setSelectedFee] = useState("");

  useEffect(() => {
    const fetchData = async () => {
      // Your existing code to fetch universitiesData
    };

    fetchData();
  }, []);

  const filteredData = universitiesData.filter((uni) => {
    if (selectedName && selectedFee) {
      return (
        uni.name === selectedName &&
        uni.fees.some((fee) => fee.admissionFee === selectedFee)
      );
    } else if (selectedName) {
      return uni.name === selectedName;
    } else if (selectedFee) {
      return uni.fees.some((fee) => fee.admissionFee === selectedFee);
    }
    return true;
  });

  return (
    <div className="w-full max-w-[1920px] mx-auto">
      <div className="p-4 border rounded-lg shadow-lg m-10">
        <div className="m-2 flex flex-col">
          <div className="flex gap-4 mb-4">
            <select
              value={selectedName}
              onChange={(e) => setSelectedName(e.target.value)}
            >
              <option value="">Select Name</option>
              {universitiesData.map((uni, index) => (
                <option key={index} value={uni.name}>
                  {uni.name}
                </option>
              ))}
            </select>
            <select
              value={selectedFee}
              onChange={(e) => setSelectedFee(e.target.value)}
            >
              <option value="">Select Fee</option>
              {universitiesData
                .reduce((fees, uni) => fees.concat(uni.fees), [])
                .map((fee, index) => (
                  <option key={index} value={fee.admissionFee}>
                    {fee.admissionFee}
                  </option>
                ))}
            </select>
          </div>
          {filteredData.map((uni, index) => (
            <div
              key={index}
              className="border p-4 mb-4 rounded-lg flex flex-col gap-7 shadow-lg"
            >
              <h2 className="text-[#3579F8] font-medium text-xl mb-4">
                {uni.name}
              </h2>
              <div>
                <h3>Fees:</h3>
                {uni.fees.map((fee, idx) => (
                  <div key={idx}>{fee.admissionFee}</div>
                ))}
              </div>
              <div className="flex gap-2 justify-center items-center">
                <Link to={`/uniDetails/${uni.name}`}>
                  <Button variant="contained" size="large">
                    View University
                  </Button>
                </Link>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default List;
